package guifabrin;

import java.awt.*;

public enum Tipo {
    POCO(-1.01, ""),
    NADA(0, null),
    PREMIO(Float.MAX_VALUE, ""),
    PAREDE(-0.01, "");

    public double valor;
    public Image imagem;

    private Tipo(double valor, String base64imagem){
        this.valor = valor;
        this.imagem = base64imagem != null ? Helper.base64ToImagem(base64imagem) : null;
    }
}